package com.bzkj.dto.activity;import java.io.Serializable;/** * @description: 活动dto * @author: jensen * @date: created by 2019/8/23 16:23 */public class ActivityInfo implements Serializable {    private static final long serialVersionUID = 5571704221140805651L;    private String activityId;    private String activityName;    private int activityStatus;    private String activityType;    private String beginTime;    private String endTime;    private String eId;    private String orgId;    public String getActivityName() {        return activityName;    }    public void setActivityName(String activityName) {        this.activityName = activityName;    }    public String geteId() {        return eId;    }    public void seteId(String eId) {        this.eId = eId;    }    public String getOrgId() {        return orgId;    }    public void setOrgId(String orgId) {        this.orgId = orgId;    }    public String getBeginTime() {        return beginTime;    }    public void setBeginTime(String beginTime) {        this.beginTime = beginTime;    }    public String getEndTime() {        return endTime;    }    public void setEndTime(String endTime) {        this.endTime = endTime;    }    public String getActivityType() {        return activityType;    }    public void setActivityType(String activityType) {        this.activityType = activityType;    }    public String getActivityId() {        return activityId;    }    public void setActivityId(String activityId) {        this.activityId = activityId;    }    public int getActivityStatus() {        return activityStatus;    }    public void setActivityStatus(int activityStatus) {        this.activityStatus = activityStatus;    }}